export const GET_NAME = "GET_NAME";
export const GET_EMAIL = "GET_EMAIL";
export const GET_AGE = "GET_AGE";

export const getName = (get_Name) => ({ type: GET_NAME, get_Name });
export const getEmail = (get_Email) => ({ type: GET_EMAIL, get_Email });
export const getAge = (get_Age) => ({ type: GET_AGE, get_Age });
